import React from 'react';
import { AppBar, Toolbar, IconButton, Typography, Button } from '@mui/material';
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import BusinessCenterIcon from '@mui/icons-material/BusinessCenter';

const useStyles = makeStyles((theme) => ({
  appBar: {
    backgroundColor: '#8B3B79', // Match the color of the top header
  },
  title: {
    flexGrow: 1,
    display: 'flex',
    alignItems: 'center',
  },
  logo: {
    marginRight: theme.spacing(2),
  },
  buttons: {
    display: 'flex',
    alignItems: 'center',
  },
  button: {
    marginLeft: theme.spacing(2),
    color: '#fff', // White text color
  },
}));

export default function Header() {
  const classes = useStyles();

  return (
    <AppBar position="static" className={classes.appBar}>
      <Toolbar>
        <div className={classes.title}>
          <img src="/path-to-logo.png" alt="Mi Tiara Logo" className={classes.logo} />
          <Typography variant="h6">Mi Tiara</Typography>
        </div>
        <div className={classes.buttons}>
          <IconButton edge="start" className={classes.button} aria-label="school">
            <AccountCircleIcon />
            <Typography variant="body1">School</Typography>
          </IconButton>
          <IconButton edge="end" className={classes.button} aria-label="login-signup">
            <Typography variant="body1">Login / Sign Up</Typography>
          </IconButton>
          <Button startIcon={<BusinessCenterIcon />} className={classes.button}>
            List Business
          </Button>
        </div>
      </Toolbar>
    </AppBar>
  );
}
